import React, { Component } from 'react'
import styled from "styled-components"
import Portal from "./Portal"

export default class Modal extends Component {
    render() {
        return (
            <Portal>
                <ModalWrapper>
                    <h1>This is the modal</h1>
                </ModalWrapper>
            </Portal>
        )
    }
}

const ModalWrapper = styled.div` 
position: absolute;
top: 1rem;
left: 1rem;
background: red;
`
